import React, { useState } from 'react';
import './App.css';
import MapComponent from './MapComponent';

function App() {
  const [tagId, setTagId] = useState('');
  const [dogData, setDogData] = useState(null);
  const [location, setLocation] = useState('');
  const [hospitalData, setHospitalData] = useState(null);

  // For Hackathon demo, we point to localhost
  const BACKEND_URL = "http://localhost:5000"; 

  const handleDogSearch = () => {
    const mockDogs = [{ DogID: "RED108", TagNumber: "108", Status: "VACCINATED", Date: "01-02-2026" }];
    const found = mockDogs.find(d => d.DogID === tagId.toUpperCase());
    setDogData(found);
  };

  const handleHospitalSearch = () => {
    setHospitalData({ name: "City Medical Center", distance: "0.8 km", phone: "+91 484 2345678" });
  };

  return (
    <div className="App">
      <header className="emergency-header">
        <h1>RabiesAware Dashboard</h1>
        <div className="emergency-actions">
          <button className="btn-emergency">üìû CALL 112</button>
          <button className="btn-firstaid">ü©π FIRST AID</button>
        </div>
      </header>

      {/* THE MAIN LAYOUT CONTAINER */}
      <main className="main-content">

        {/* LEFT COLUMN: Map and Tag Verification */}
        <div className="search-side">
          <div className="card map-card">
            <h2>üåç Live Sighting Heatmap & Reporting</h2>
            <MapComponent backendUrl={BACKEND_URL} />
          </div>

          <div className="card">
            <h2>üîç Verify Vaccination Tag</h2>
            <div className="input-group">
              <input 
                type="text" 
                placeholder="Enter Tag ID (e.g. RED108)" 
                value={tagId} 
                onChange={(e) => setTagId(e.target.value)} 
              />
              <button className="btn-verify" onClick={handleDogSearch}>VERIFY</button>
            </div>
            {dogData && (
              <div className="status-box green-box">
                <p><strong>Status:</strong> {dogData.Status}</p>
                <p>Tag No: {dogData.TagNumber} | Expiry: {dogData.Date}</p>
              </div>
            )}
          </div>
        </div>

        {/* RIGHT COLUMN: ABC Center Sidebar */}
        <aside className="report-side">
          <div className="report-card">
            <h2>üì¢ ABC Center Information</h2>
            <p>Reported sightings are sent directly to the nearest Animal Birth Control center.</p>
            <div className="abc-info">
              <strong>Kochi ABC Center</strong>
              <p>Status: Active</p>
              <button className="btn-call-abc">üìû CONTACT ABC</button>
            </div>
          </div>

          <div className="card">
            <h2>üè• Nearby Medical Help</h2>
            <div className="input-group">
              <input 
                type="text" 
                placeholder="City Name..." 
                value={location} 
                onChange={(e) => setLocation(e.target.value)} 
              />
              <button onClick={handleHospitalSearch}>SEARCH</button>
            </div>
            {hospitalData && (
              <div className="status-box red-box">
                <h3>üìç {hospitalData.name}</h3>
                <p>Distance: {hospitalData.distance}</p>
                <p>Contact: {hospitalData.phone}</p>
                <button className="btn-call-small">CALL HOSPITAL</button>
              </div>
            )}
          </div>
        </aside>

      </main>
    </div>
  );
}

export default App;
